declare
ls_query VARCHAR2(400);
li_valid_class_max number(10);
begin
select max(VALID_CLASS_REPORT_FREQ_ID) into li_valid_class_max FROM VALID_CLASS_REPORT_FREQ;
ls_query:='alter sequence SEQ_VALID_CLASS_REPORT_FREQ increment by '||li_valid_class_max;      
execute immediate(ls_query);  
end;
/
